# Novotroitskoye, Chishminsky District, Republic of Bashkortostan

}}
Novotroitskoye () is a rural locality (a selo) and the administrative centre of Novotroitsky Selsoviet, Chishminsky District, Bashkortostan, Russia. The rural locality has 11 streets and, as of 2010, a population of 411.
Geography
Novotroitskoye is located 22&nbsp;km southeast of Chishmy, the district's administrative centre. Novosayranovo is the nearest rural locality.
